    {
        id: 1,
        name: "Smart Televisions",
        discount: 20,
        image: item1,
        color: "#8265d3"
    },
    {
        id: 2,
        name: "Smart Televisions",
        discount: 20,
        image: item2,
        color: "#649dd2"
    },
    {
        id: 3,
        name: "Smart Televisions",
        discount: 20,
        image: item3,
        color: "#64d289"
    },
]

export default offers;
